div.font:
// Create backend factory.


BackendFactory backendFactory = new BackendFactory()




// Get a backend instance of desired type.


Backend backend = backendFactory.get(type = "async")




// Create context manager factory to consume the backend.


ContextFactory contextFactory = new ContextFactory()




// If the backend supports progress tracking.


if (backend.supportsProgress())


// Use a progress-capable context.


Context context = contextFactory.get(type = "progress")




// Create a progress bar factory.


BarFactory barFactory = new BarFactory()




// Get a bar instance.


Bar bar = barFactory.get(type = "modern")




// Set the bar on the context.


context.setBar(bar)




// Configure the bar.


context.configureBar(...)


else


// Use a standard context.


Context context = contextFactory.get(type = "regular")




// Register the backend with the context manager.


context.setBackend(backend)




// Create cluster specification.


Specification specification = new Specification()




// Set the number of cores.


specification.setCores(cores = 9)




// Set the cluster type.


specification.setType(type = "psock")




// Start the backend.


context.start(specification = specification)




// Run the task asynchronously on the backend.


context.sapply(x = x, fun = fun, ...)




// Get the results when the task finished.


vector results = context.getOutput()




// Stop the backend.


context.stop()

// Create temporary file.


string filePath = ...




return filePath

// Add progress logging to task function.


function task = ...




return task

// Create file for logging progress.


string log = this.makeLog()




// Decorate task function.


function task = this.decorate(task = fun, log = log)




// Execute the decorated task.


super.sapply(x = x, fun = task, ...)




// Show the progress and block the main process.


this.showProgress(total = length(x), log = log)

// Create bar.


this.bar.create(total = total, initial = 0, this.barConfig)




// Get number of processed tasks from log.


int processedTasks = ...




// Increment bar.


while (processedTasks < total)


// Update bar.


this.bar.update(processedTasks)




// Terminate the bar.


this.bar.terminate()

// Validate backend type.


if (backend not of class AsyncBackend)


throw error("not assignable")




// Set the backend.


super.setBackend(backend)

